+.mobile-navbar {
+    background-color: #333;
+    color: white;
+    padding: 10px;
+    position: relative;
+}
+
+.menu-toggle {
+    font-size: 24px;
+    background: none;
+    color: white;
+    border: none;
+    cursor: pointer;
+}
+
+.mobile-menu {
+    display: flex;
+    flex-direction: column;
+    position: absolute;
+    top: 100%;
+    left: 0;
+    width: 100%;
+    background-color: #333;
+    padding: 10px 0;
+    list-style: none;
+    margin: 0;
+}
+
+.mobile-menu li {
+    padding: 10px 20px;
+    border-bottom: 1px solid #444;
+    color: white;
+    cursor: pointer;
+    
+}
+
+.mobile-menu li:hover {
+    background-color: #555;
+}
+.desktop-navbar {
+    display: flex;
+    justify-content: space-around;
+    background-color: #333;
+    color: white;
+    padding: 10px 20px;
+}
+
+.desktop-navbar ul {
+    display: flex;
+    list-style: none;
+    padding: 0;
+    margin: 0;
+}
+
+.desktop-navbar li {
+    margin: 0 15px;
+    cursor: pointer;
+    color: white;
+}
+
+.desktop-navbar li:hover {
+    text-decoration: underline;
+}
